Template.CreateMeme.events({
  'keyup input': function (e, tmpl) {
      var topText = tmpl.find('#top-line').value;
      var bottomText = tmpl.find('#bottom-line').value;
      Meme(imageBase64, 'canvas', topText, bottomText);
   }
});

